import React from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";
import { AppBar } from "@mui/material";
import { Toolbar } from "@mui/material";
import { Typography } from "@mui/material";



const NavigationBar = ( { logout }) => {
    return (
        <header>
            <AppBar>
                <Toolbar>
                    <Typography>
                        <Link to="/">Stranger's Things</Link>
                    </Typography>
                </Toolbar>


                <Link to="/">Stranger's Things</Link>
                <Link className="nav-links" to="/">Home</Link>
                <Link className="nav-links" to="/register">Register</Link>
                <Link className="nav-links" to="/posts">Posts</Link>
                <Link className="nav-links" to="/profile">Profile</Link>
                <Link className="login-link" to="/login">Login</Link>
                <Link className="logout-link" to="/" onClick={() => logout()}>Logout</Link>
            </AppBar>
        </header>
    )
}

export default NavigationBar
